import React from 'react';
import '../resources/css/custom.css'
import { Container, Col, Row, Navbar} from 'react-bootstrap';
import Sidebar from '../components/Sidebar';
import NavBar from '../components/NavBar';
import Box from '../components/Box'

const LastPublished = (props) => {
    return (
        <div className='box h220'>
            <p>{props.data}</p>
        </div>
    )
}
const Home = () => {

    const MainSection = (props) => {
        return (
            <div>
                <Container>
                    <br/>
                <h4 className="custom-font">การเดินทางของพวกเรา</h4>
                <Row>
                    <Col sm={12} lg={8}>
                        <LastPublished data="Card1" />
                    </Col>
                    <Col sm={12} lg={4}>
                        <Col><Box data="Card2" /></Col>
                        <Col><Box data="Card3" /></Col>
                    </Col>
                </Row>
                <Row>
                    <Col lg={4}>
                        <Box data="Other card" />
                    </Col>
                    <Col lg={4}>
                        <Box data="Other card" />
                    </Col>
                    <Col lg={4}>
                        <Box data="Other card" />
                    </Col>
                    <Col lg={4}>
                        <Box data="Other card" />
                    </Col>
                </Row>
                </Container>



            </div>
        )
    }
    return (
        <div>

            <NavBar/>
                <Row>
                    <Col className='no-left-padding' lg={10} sm={9} ><MainSection /></Col>
                </Row>
        </div>
    );
};

export default Home;
